import { Fragment } from "react";
import Header from './header.js'

const Inputs = ({ header, children }) => { return (
    <Fragment>
        <Header text={ header } />
        <div className={ 'content' }>
            { children }
        </div>
    </Fragment>
)}

const Text = ({ label, value, func }) => { return (
    <div>
        <input
            placeholder={ label }
            onChange={ func }
        />
    </div>
)}

const Number = ({ label, value, func }) => { return (
    <div>
        <input
            placeholder={ label }
            onChange={ func }
        />
    </div>
)}

export {
    Inputs,
    Text,
    Number
}
